SET THE REMINDER FOR TODAY, 18th October at 7PM to witness the much-awaited 'Smritiyaan' concert series - live from the stage, a musical tribute on the 55th death anniversary of the Tabla Wizard Pandit Chatur Lal.

Don\xe2\x80\x99t miss the mesmerizing performances of renowned artists SOORYAGAYATHRI (Jr M.S. Subbulakshmi), Prince of Tabla PRANSHU CHATUR LAL and first time ever musical JUGALBANDI by celebrated Indian folk singer Padma Shri MALINI AWASTHI, Kathak Maestra Padma Shri SHOVANA NARAYAN.

A click on the following link will help you to watch them live from the stage:
https://youtu.be/8uH_Cg6MCGY

Looking forward to your benign presence virtually this year.

Presented by @indusind_bank Supported by @sbilifeinsurance & @iccr_delhi Digital Partner- @indianraga

